import React from 'react';

import style from './Movie.module.css';

const Planet = (props) => {
  return (
    <li className={style.movie}>
    <h3>{props.id}</h3>
    <img/>
    <h3>{props.climate}</h3>
    <h3>{props.terrain}</h3>
    <h2>{props.pops}</h2>
  </li>
  );
};

export default Planet;
